<h4>高德API获取定位信息getCurrentPosition返回的message原因解析：</h4>
<p>1、Get ipLocation failed：IP精确定位失败，精确IP定位服务目前无法完全覆盖所有用户IP，失败率在5%左右；</p>
<p>2、sdk定位失败：请检查sdk的key是否设置好，以及webview的定位权限及应用和系统的定位权限是否开启。</p>
<p>3、浏览器定位失败，有多种情况： </p>
<p>1）Browser not Support html5 geolocation：浏览器不支持原生定位接口，如IE较低版本的浏览器等； </p>
<p><img alt="snipaste20230314_134245"
    src="data:image/png;base64," />2）Geolocation
  permission denied：用户禁用了定位权限，需要用户开启设备和浏览器的定位权限，并在浏览器弹窗中点击“允许使用定位”选项。 </p>
<p>3）Geolocation permission
  denied：浏览器禁止了非安全域的定位请求，比如Chrome、IOS10已陆续禁止，这时候需要升级站点到HTTPS。注意Chrome不会禁止localhost等域名HTTP协议下的定位。</p>
<p>4）Geolocation permission denied：Access to geolocation was blocked over secure connection with mixed
  content，也就是在Https的页面中引用的http的资源。</p>
<p>5）Get geolocation time out：浏览器定位超时，包括原生的超时，可以适当增加超时属性的设定值以减少这一现象，另外还有个别浏览器（如google
  Chrome浏览器等）本身的定位接口是黑洞，通过其请求定位完全没有回应，也会超时返回失败。</p>
<p>6）Get geolocation failed：定位失败，Chrome、火狐以及部分套壳浏览器接入的定位服务在国外，有较大限制，失败率高。</p>
<p>注释：如果定位到城市即可满足需求，建议大家改用Geolocation.getCityInfo方法，可以根据IP返回用户所在城市的基本信息，包括省、市名称、adcode、citycode、城市中心点，城市矩形边界等信息。</p>
<p>· 2362 · 中华医学杂志 2024 年 7 月2 日第 104 卷第 25 期 Natl MedJ China, July 2, 2024, Vol. 104, No. 25</p>
