  检查：左臀部可触及大小约 10 cm×8 cm 肿物，压痛及触痛阳 性，左下肢麻木 。MRI 可见左侧臀部的臀大肌与股方肌之 间（靠近坐骨神经走行区）存在囊性占位性病变，最大径线 3.6
  cm，边缘光滑，并可见絮状的高信号经臀肌直接联系至 皮下，周围的筋膜间隔增厚（图 1、2）。入院后患者行左髋关 节镜下探查清理，病理活检示：肿瘤大小为 4.5 cm×2.6 cm， 表面包膜完整，切面呈囊实性，灰白间灰褐，质软，免疫组化
